import React from 'react';
import Position from "../components/position";
import "./352style.css";
function Formation352() {


  const handleRoleChange = (role) => {
    // Do something with the selected role
    console.log("Selected role:", role);
  };

  return (
    <div className="formation352">
      <div className="attackLane352">
        <Position playerName={players[0]} positionName="ATTACK" roles={roles}
          onRoleChange={handleRoleChange}  />
        <Position playerName={players[1]} positionName="ATTACK" roles={roles}
          onRoleChange={handleRoleChange}  />
      </div>
      <div className="midLane352">
        <Position playerName={players[2]} positionName="LAT" />
        <Position playerName={players[3]} positionName="MID" />
        <Position playerName={players[4]} positionName="MID" />
        <Position playerName={players[5]} positionName="MID" />
        <Position playerName={players[6]} positionName="LAT" />
      </div>
      <div className="backLane352">
        <Position playerName={players[7]} positionName="DEF" />
        <Position playerName={players[8]} positionName="DEF" />
        <Position playerName={players[9]} positionName="DEF" />
      </div>
      <div className="gkLane352">
        <Position playerName={players[10]} positionName="GK" />
      </div>
    </div>

  );
}

export default Formation352;
